import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  const board = List<Array<BoardSquare>>;
  const selected = [-1, -1];
  const enPassantSquare = [-1, -1];
  const enPassantVictim = [-1, -1];
  let boardReady = true;
  let whiteTurn = true;
  let checkedColor = "";

  document.addEventListener('DOMContentLoaded', function () {
    const whiteDisplay = document.getElementById("WhiteDisplay")
    const blackDisplay = document.getElementById("BlackDisplay");

    if (whiteDisplay !== null && whiteDisplay.children.length === 0) {
        whiteDisplay.style.display = 'none';
    }

    if (blackDisplay !== null && blackDisplay.children.length === 0) {
        blackDisplay.style.display = 'none';
    }

    const pieceOrder = [ "Rook", "Knight", "Bishop", "Queen", "King", "Bishop", "Knight", "Rook" ];
    let whiteSquare = true;
    let whitePiece = false;
    let pieceClass = "";

    for (var i = 0; i < 8; i++) {
        board
        for (var j = 0; j < 8; j++) {
            const args = {
              piece: "",
              row: 0,
              col: 0,
              backColor: ""
             };

            if (i == 0 || i == 7) {
                args.piece = (whitePiece ? "white|" : "black|") + pieceOrder[j];
            }
            else if (i == 1 || i == 6) {
                args.piece = whitePiece ? "white|Pawn" : "black|Pawn";
            }

            args.col = i;
            args.row = j;
            args.backColor = (whiteSquare ? "white" : "black");

            board[i][j] = new boardSquare(args);

            pieceClass = board[i][j].backColor + " boardBtn";

            if (args.piece && args.piece != "") 
            {
                pieceClass += " " + args.piece.split('|').join('');
            }

            $(`<div id="board` + i.toString() + j.toString() + `" class='` + pieceClass + `' onclick="boardClick('` + args.col + `', '` + args.row + `')"></div>`).appendTo($(".GameBoard"));


            whiteSquare = !whiteSquare;
        }

        if (i == 1) {
            whitePiece = !whitePiece;
        }

        whiteSquare = !whiteSquare;
    }
  });

  function boardClick(col, row) {
      if (!boardReady || ((board[col][row].piece.split('|')[0] != "white") && !board[col][row].isHighlighted)) {
          return;
      }

      boardReady = false;
      $.ajax({
          url: "../api/chess",
          method: "POST",
          data: {
              board: JSON.stringify(board),
              selected: JSON.stringify(selected),
              enPassantSquare: JSON.stringify(enPassantSquare),
              enPassantVictim: JSON.stringify(enPassantVictim),
              col: col,
              row: row,
              checkedColor: checkedColor
          },
          success: function (data) {
              buildBoard(data);

              if (!whiteTurn) {
                  $.ajax({
                      url: "../api/chess",
                      method: "POST",
                      data: {
                          board: JSON.stringify(board),
                          enPassantSquare: JSON.stringify(enPassantSquare),
                          enPassantVictim: JSON.stringify(enPassantVictim),
                          checkedColor: checkedColor,
                          compTurn: true
                      },
                      success: function (data) {
                          buildBoard(data);
                          boardReady = true;
                      }
                  });
              }
              else {
                  boardReady = true;
              }
          }
      });
  }

  function buildBoard(data) {
      var args = {
          isSelected: false,
          isHighlighted: false,
          piece: "",
          row: "",
          col: "",
          blackPressure: 0,
          whitePressure: 0,
          hasMoved: false,
          enPassantColor: "",
          backColor: "",
          pinDir: "",
          inCheck: false,
          blockCheckcolor: "",
          checkmate: false,
          whitePressureSource: "",
          blackPressureSource: ""
      };

      selected = [];
      enPassantVictim = [-1, -1];
      enPassantSquare = [-1, -1];
      checkedColor = "";

      for (var i = 0; i < 8; i++) {
          for (var j = 0; j < 8; j++) {
              var index = (i * 8) + j;
              var square = data[index];

              args.isSelected = square.isSelected;
              args.isHighlighted = square.isHighlighted;
              args.hasMoved = square.hasMoved;
              args.enPassantColor = square.enPassantColor;
              args.blackPressure = square.blackPressure;
              args.whitePressure = square.whitePressure;
              args.col = square.coords[0];
              args.row = square.coords[1];
              args.pinned = square.pinned;
              args.blockCheckColor = square.blockCheckColor;
              args.checkmate = square.checkmate;
              args.whitePressureSource = square.whitePressureSource;
              args.blackPressureSource = square.blackPressureSource;
              args.inCheck = square.inCheck;
              args.pinDir = square.pinDir;

              if (square.moved) {
                  whiteTurn = !whiteTurn;
              }

              if (args.inCheck) {
                  checkedColor = square.piece.color;
              }

              if (square.piece && square.piece !== null) {
                  args.piece = square.piece.color + "|" + square.piece.type;
              }
              else {
                  args.piece = "";
              }

              if (square.isSelected) {
                  selected = [parseInt(square.coords[0]), parseInt(square.coords[1])];
              }

              if (args.checkmate) {
                  alert('checkmate ' + square.piece.color);
              }

              if (square.enPassantColor != "" && square.enPassantVictim != null) {
                  enPassantSquare = square.coords;
                  enPassantVictim = [parseInt(square.enPassantVictim[0]), parseInt(square.enPassantVictim[1])];
              }

              args.backColor = board[i][j].backColor;

              board[i][j] = new boardSquare(args);
              board[i][j].setClass();
          }
      }
  }

  return (
    <>
      <div className="pieceDisplay" id="WhiteDisplay"></div>
      <div id="GameBoard" className="GameBoard"></div>
      <div className="pieceDisplay" id="BlackDisplay"></div>
    </>
  );
}

export default App;
